// Dashboard.js
import React from 'react';
import { Link, Route, Switch } from 'react-router-dom';
import UserInfo from '../components/features/';
import Orders from './Orders';
import AccountManagement from './Dashboard';

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <nav>
        <ul>
          <li><Link to="/dashboard/user-info">User Info</Link></li>
          <li><Link to="/dashboard/orders">Orders</Link></li>
          <li><Link to="/dashboard/account-management">Account Management</Link></li>
        </ul>
      </nav>
      <Switch>
        <Route path="/dashboard/user-info" component={UserInfo} />
        <Route path="/dashboard/orders" component={Orders} />
        <Route path="/dashboard/account-management" component={AccountManagement} />
      </Switch>
    </div>
  );
};

export default Dashboard;
